import React from 'react'

import QnAPublicViewItem from './QnAPublicViewItem'

class QnAPublicView extends React.Component {
  constructor(props) {
    super(props)
    this.state = {}
  }

  handleAnswerQNA = () => {}

  render() {
    const {
      props: { publicQnA, authorizedView }
    } = this
    return (
      <div className='qnaPublicView'>
        <div className='title'>Danh sách câu hỏi:</div>

        <div className='qnaPublicViewWrapper'>
          {publicQnA.map((qnaItem, index) => (
            <div key={index} className='qnaPublicViewItem'>
              <QnAPublicViewItem qnaItem={qnaItem} authorizedView={authorizedView} />
            </div>
          ))}
        </div>
      </div>
    )
  }
}

export default QnAPublicView
